    "avance": "El taller de prototipado ha sido proyectado en primera instancia gracias a la adjudicación de fondos FIC del Gobierno Regional del Biobío, que ha abierto esta posibilidad mediante financiamiento directo en equipamiento, sin embargo para el logro del objetivo ha sido necesario apoyo complementario.\nEl estado de avance es el siguiente:\n- Noviembre/diciembre: compra primeras máquinas para equipamiento con fondos FIC\n- Enero/febrero 2015: Ejecución proyecto de remodelación infraestructura para nuevo taller de prototipado, con fondos gestionados directamente por la Decano e iCubo con Rectoría UDD.\n- Marzo a Mayo: recepción, capacitación y puesta en marcha de la primera compra de máquinas con fondos FIC, que contemplan 2 impresoras 3D Makerbot y una cortadora laser CNC.\n\nPor implementar:\n- 2° semestre 2015: adquisición e instalación de mobiliario específico para el taller (actualmente se cuenta con mobiliario provisorio que no cubre adecuadamente las necesidades). Esta adquisición se realizará gracias al proyecto Area IX, financiado por Convenio de Desempeño adjudicado por la Facultad de Diseño.\n- Fines de 2015, 1° semestre 2016? 2° compra de maquinaria con fondos FIC, contempla una cortadora Router CNC para tableros de madera. Esta compra depende de la liberación de los fondos por parte del Gobierno Regional del Biobío, lo cual ha presentado reiterados atrasos e incertidumbre de fechas, por lo cual no es posible asegurar una fecha de cumplimiento.",
